.top-wrap{
  background: url("https://chaindown-oss.oss-cn-hongkong.aliyuncs.com/static/1/images/90c51538c13c6e94858d447db23ea83d.png") center bottom no-repeat rgb(16, 15, 16);
  background-size: cover;
}
.top-content{
  color: #EDF4F8;
  padding: 70px 0;
}
.top-content, .main-content{
  margin: 0 auto;
  width: 1180px;
}
.main-content{
  margin-top: 40px;
  background: rgba(12,12,8,0.5);
}
.title{
  text-align: center;
  font-size: 32px;
  width: 1180px;
  margin: 0 auto;
  color: #FFFFFF;
}
.info{
  display: flex;
  justify-content: center;
  margin: 50px 0 20px;
}
.info__item{
  min-width: 180px;
  height: 70px;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  border-left: 1px solid #293448;
  padding-left: 20px;
}
.info__item-num{
  font-size: 32px;
}
.info__item-symbol{
  font-size: 14px;
}
.info__item-text{
  color: #828EA1;
  font-size: 14px;
}

.list-tit{
  height: 54px;
  line-height: 51px;
  padding: 0 20px;
  border-bottom-width: 1px;
  border-bottom-style: solid;
  background: rgba(18,18,16,0.5);

}
.list-tit__item-selected{
  border-bottom-width: 2px;
  border-bottom-style: solid;
  border-color: #F39800;
  color:#EDF4F8;
}
.list-tit__item{
  display: inline-block;
  font-size: 14px;
  margin-right: 50px;
  height: 51px;
  user-select: none;
  cursor: pointer;
}
